import React from 'react';

const WordSummary = ({magooshWord}) => {
    return (
        <li className="btn list-group-item list-group-item-action bg-light border-info mt-2">
            <div className="collapsed" data-toggle="collapse" href="#wordID">
                <h5><span className="badge badge-info">{magooshWord.word}</span></h5>
                <span className=" text-muted">{magooshWord.definition}</span>
            </div>
            <div id="wordID" className="collapse mt-1" data-parent="#accordion">
                <div className="border-top border-info">
                <h6 className="mt-2">Word Details</h6>
                <h6>Synonym</h6>
                </div>
            </div>
        </li>
    )
}

export default WordSummary;
